import React from 'react';
import './SongRow.css'

export default function SongRow({track='test'}) {

const handle__play = ({track, ch}) =>{
    chooseTrack(track)
}

    return (
        <div className= 'songRow' onClick={handle__play}>
            <img className='songRow__album' src={track.image__url? track.image__url: track.album.images[0].url} alt='song image'/>
            <div className="songRow__info">
                <h1>{track.name}</h1>
                <p>
                    {track.artists.map((artist) => artist.name).join(",  ")}{" - "}
                    {track.name}
                </p>
            </div>
            
        </div>
    )
}
